"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[2409],{82409:(e,r,s)=>{s.r(r),s.d(r,{default:()=>t});let t="# [Galerie Game Boy Camera](https://github.com/HerrZatacke/gb-printer-web)\n\nLa Galerie Game Boy Camera est une application web pour organiser, \xe9diter et partager les photos prises avec la Game Boy Camera.\n\n## [Galerie](/gallery)\nVisualisez et g\xe9rez toutes les photos import\xe9es dans une galerie responsive :\n- \xc9tiquetez les images\n- Combinez les photos en groupes d'images\n- Filtrez votre collection\n- Visualisez les m\xe9tadonn\xe9es des savestates de ROMs comme [Photo!](https://github.com/untoxa/gb-photo) ou la ROM originale de la Game Boy Camera\n- Imprimez les images sur une Game Boy Printer originale en utilisant des dispositifs de communication s\xe9rie\n\n### Groupes d'Images\nOrganisez les images li\xe9es ensemble en groupes :\n- Cr\xe9ez des groupes en s\xe9lectionnant plusieurs images et en les regroupant via le menu contextuel d'une image s\xe9lectionn\xe9e\n- Les groupes peuvent \xeatre cr\xe9\xe9s automatiquement pendant un processus d'importation ou lors de la g\xe9n\xe9ration d'images RGB\n- S\xe9lectionnez des images pour les d\xe9placer entre les groupes sans n\xe9cessairement cr\xe9er un nouveau groupe\n\n## [Communication S\xe9rie](/webusb)\nConnectez-vous directement aux dispositifs de projets communautaires en utilisant WebSerial :\n\n### Impression sur une Game Boy Printer physique\n- Avec WebSerial activ\xe9, imprimez des images sur une Game Boy Printer originale en utilisant l'[interface Super Printer](https://github.com/Raphael-Boichot/Yet-another-PC-to-Game-Boy-Printer-interface/) par Rapha\xebl Boichot\n\n### Communication avec Cartouche\n- Activez WebSerial dans Chrome pour communiquer directement avec le GBxCart (ordinateur de bureau uniquement)\n- Utilisez un lecteur de cartouche avec le firmware de Lesserkuma pour charger les savestates (par ex. [GBxCart RW](https://www.gbxcart.com/), [JoeyJr](https://bennvenn.myshopify.com/products/usb-gb-c-cart-dumper-the-joey-jr), [GBFlash](https://github.com/simonkwng/GBFlash))\n\n### \xc9mulateurs de Game Boy Printer\nConnectez un \xe9mulateur d'imprimante via WebSerial pour imprimer depuis votre Game Boy Camera directement vers l'application web :\n- [arduino-gameboy-printer-emulator](https://github.com/mofosyne/arduino-gameboy-printer-emulator) – \xc9mulateur bas\xe9 sur Arduino par mofosyne\n- [pico-gb-printer](https://github.com/untoxa/pico-gb-printer/) – Impl\xe9mentation Raspberry Pi Pico par untoxa\n- [NeoGB-Printer](https://github.com/zenaror/NeoGB-Printer) – Impl\xe9mentation Arduino Nano par Rafael Zenaro\n- [wifi-gbp-emulator](https://github.com/HerrZatacke/wifi-gbp-emulator) – \xc9mulateur WiFi ESP8266 avec serveur web int\xe9gr\xe9 qui peut h\xe9berger cette webapp\n\n## [Import](/import)\nImportez des images depuis plusieurs sources par glisser-d\xe9poser :\n- Savestates de cartouche (dumps `.sav` incluant la version 1MB de [FlashGBX](https://github.com/lesserkuma/FlashGBX))\n- Logs hex s\xe9rie de Game Boy Printer\n- Fichiers bitmap de projets qui ne produisent que des images de base\n\n## [Cadres](/frames)\nAjoutez, \xe9ditez et partagez des cadres de Game Boy Camera :\n- D\xe9posez une image (de pr\xe9f\xe9rence 160 \xd7 144) pour cr\xe9er un nouveau cadre ou g\xe9n\xe9rez des cadres pendant l'importation depuis n'importe quelle source de donn\xe9es\n- Importez/exportez des packs de cadres complets en JSON pour les partager avec d'autres\n\n## [Palettes](/palettes)\nTravaillez avec des palettes de couleurs :\n- Choisissez parmi les palettes int\xe9gr\xe9es\n- Concevez des palettes personnalis\xe9es\n- Extrayez des couleurs de photographies ordinaires pour cr\xe9er de nouvelles palettes\n- Importez/exportez des palettes en JSON pour les partager avec d'autres\n\n## [Plugins](/settings/plugins)\n\xc9tendez la bo\xeete \xe0 outils avec des plug-ins communautaires :\n- \xab Average \xbb – Cr\xe9ez des images composites \xe0 partir de plusieurs prises (style HDR)\n- \xab Custom Pixels \xbb – Remplacez des pixels individuels par des repr\xe9sentations d\xe9taill\xe9es\n\n## [Synchronisation Dropbox](/settings/dropbox)\nGardez votre galerie synchronis\xe9e sur tous vos appareils. Activez Dropbox et vous pourrez synchroniser votre biblioth\xe8que.\n"}}]);